import React from 'react'
import images from "./images";
import ListOfImages from './listofimages'

function Technologylist() {

    return (
        <div className="technologylist">
            {images.map((e, i) =>
                <ListOfImages
                    photo={e.photo}
                    text={e.text}
                    key={i}
                />
            )}
        </div>
    );
}

export default Technologylist;
